import{_ as r,e as p,o as n,c as o,a,f as s,d,b as e}from"./app.3398e39f.js";var i="/assets/blogImg/diary-13.jpg";const c={},h=d('<h2 id="date-2016-10-20-10-36" tabindex="-1"><a class="header-anchor" href="#date-2016-10-20-10-36" aria-hidden="true">#</a> date: 2016-10-20 10:36</h2><p><img src="'+i+'" alt=""></p><p>\u201C\u6211\u8981\u56DE\u6B66\u6C49\uFF01\u201D \u8FD9\u53E5\u8BDD\u8BF4\u4E86\u4E00\u5343\u904D\uFF0C\u7EC8\u4E8E\u5151\u73B0\u6210\u4E00\u5F20\u52A8\u8F66\u7968\u3002</p><p>\u4E09\u5E74\u524D\uFF0C\u6BD5\u4E1A\u7684\u7B2C\u4E8C\u5929\uFF0C\u884C\u674E\u88AB\u76D7\uFF0C\u5927\u5B66\u65F6\u6240\u6709\u7684\u7269\u4EF6\u4ED8\u4E4B\u4E1C\u6D41\u3002 \u80CC\u7740\u7A7A\u7A7A\u7684\u884C\u56CA\u56DE\u5BB6\uFF0C\u8D8A\u60F3\u8D8A\u59D4\u5C48\uFF0C\u5BFC\u6F14\u5267\u672C\u4E0D\u5BF9\u554A\uFF0C\u4EBA\u5BB6\u897F\u6E38\u8BB0\u516B\u5341\u4E00\u96BE\uFF0C\u597D\u6B79\u662F\u4E2A HAPPY ENDING\u2026 \u611F\u89C9\u81EA\u5DF1\u6709\u4E00\u79CD\u8FF7\u4E4B\u4F53\u8D28\uFF0C\u603B\u53EF\u4EE5\u628A\u5E73\u9759\u7684\u751F\u6D3B\u8FC7\u5F97\u6CE2\u6F9C\u58EE\u9614\u3002 \u5DE6\u8138\u9ED1\u7EBF\uFF0C\u53F3\u8138\u5FAE\u7B11\uFF0C\u8FD9\u79CD\u6280\u80FD\u4E0D\u662F\u8C01\u90FD\u53EF\u4EE5\uFF0C\u6211\u5728\u8003\u8651\u8981\u4E0D\u7533\u4E2A\u9057\u3002</p><p>\u603B\u4E4B\uFF0C\u56FD\u5E86\u540E\u5927\u5BB6\u90FD\u8FD4\u5DE5\uFF0C\u8FC7\u4E0A\u5C81\u6708\u9759\u597D\u7684\u751F\u6D3B\u65F6\uFF0C\u6211\u4E00\u4E2A\u4EBA\u625B\u8D77\u4E86\u5230\u6B66\u6C49\u641E\u4E8B\u60C5\u7684\u5927\u65D7\u3002</p><h3 id="\u529E\u8BC1" tabindex="-1"><a class="header-anchor" href="#\u529E\u8BC1" aria-hidden="true">#</a> \u529E\u8BC1</h3><p>\u9996\u5148\u6211\u8981\u529E\u4E00\u4E9B\u8BC1\u4EF6\u3002 \u800C\u6D41\u7A0B\u7684\u8D77\u6E90\uFF0C\u662F\u6211\u9700\u8981\u5230\u9662\u6559\u52A1\u5904\uFF0C\u76D6\u4E00\u4E2A\u7AE0\u3002 \u6240\u4EE5\u6211\u5C31\u6765\u5230\u5927\u96F7\u97F3\u5BFA\uFF0C\u5982\u6765\u4F5B\u95EE\uFF1A\u4EC0\u4E48\u4E8B\uFF1F \u6211\uFF1A\u6211\u7684\u7ECF\u4E66\u4E22\u4E86\u3002 \u4F5B\uFF1A\u8C01\u53EF\u4EE5\u8BC1\u660E\u4F60\u662F\u53D6\u7ECF\u4EBA\uFF1F \u6211\uFF1A\u674E\u4E16\u6C11 \u4F5B\uFF1A\u90A3\u4F60\u7ED9\u674E\u4E16\u6C11\u6253\u4E2A\u7535\u8BDD \u6211\uFF1A\u2026</p><p>\u76D6\u8FD9\u4E2A\u7AE0\u7684\u5173\u952E\uFF0C\u5C31\u662F\u8981\u7ED9\u5F53\u5E74\u7684\u8F85\u5BFC\u5458\u6253\u4E00\u4E2A\u7535\u8BDD\uFF0C\u800C\u4ED6\u4E5F\u8981\u8BB0\u5F97\u8D77\u6211\u3002 \u62E8\u901A\u7535\u8BDD\u7684\u90A3\u4E00\u523B\uFF0C\u5FC3\u91CC\u5FD0\u5FD1\u4E0D\u5B89\u3002 \u636E\u8BF4\u674E\u4E16\u6C11\u65E9\u5DF2\u4E0D\u5F53\u7687\u5E1D\uFF0C\u4ED6\u53BB\u4E86\u4E91\u5357\uFF0C\u8BF4\u4E0D\u5B9A\u6B63\u5728\u82CD\u5C71\u6D31\u6D77\u65C1\u845B\u4F18\u8EBA\uFF0C\u8FC7\u7740\u5F80\u4E8B\u5982\u70DF\u7684\u751F\u6D3B\u3002 \u800C\u6211\u53EF\u80FD\u8FDE\u5982\u70DF\u4E5F\u7B97\u4E0D\u4E0A\uFF0C\u53EA\u662F\u4E00\u9897\u5C0F\u5C0F\u7684\u7070\u70EC\u3002 \u4ED6\u4F1A\u8BB0\u5F97\u6211\u5417\uFF1F</p><p>\u7535\u8BDD\u901A\u4E86\uFF0C\u848B\u5BFC\u7684\u55D3\u97F3\u8C8C\u4F3C\u521A\u7761\u9192\u2026\u6211\u5FC3\u91CC\u65E9\u5DF2\u51C6\u5907\u597D\u51E0\u5343\u5B57\u7684\u81EA\u6211\u4ECB\u7ECD\u3002 \u5E78\u8FD0\u7684\u662F\uFF0C\u6211\u521A\u8BF4\u51FA\u540D\u5B57\uFF0C\u4ED6\u5C31\u8BB0\u8D77\u4E86\u6211\uFF0C\u8FD8\u8BF4\u4E86\u51E0\u4EF6\u5370\u8C61\u6DF1\u523B\u7684\u5F80\u4E8B\u3002 \u8FD9\u8BF4\u660E\u6211\u547D\u91CC\u8FD8\u662F\u6709\u633A\u591A\u8D35\u4EBA\uFF0C\u5982\u679C\u6CA1\u6709\u4F60\u4EEC\uFF0C\u6211\u8FDE\u90A3\u534A\u5F20\u8138\u7684\u5FAE\u7B11\u90FD\u4F1A\u6CA1\u6709\u3002</p><p>\u8FD8\u7B97\u987A\u5229\uFF0C\u62FF\u7740\u76D6\u7AE0\u7684\u8BC1\u660E\u5230\u4E86\u6237\u653F\u79D1\u3002 \u8FD9\u4E2A\u65F6\u5019\uFF0C\u529E\u7406\u4E1A\u52A1\u7684\u4EBA\u5BE5\u5BE5\u65E0\u51E0\uFF0C\u706B\u7206\u7684\u6B66\u6C49\u4E5F\u968F\u5883\u9047\u53D8\u5F97\u67D4\u548C\u8D77\u6765\u3002 \u5DE5\u4F5C\u7684\u5927\u59D0\u6E29\u67D4\u5730\u8BF4\uFF0C\u4F60\u4E0B\u5348\u6765\uFF0C\u73B0\u5728\u529E\u4E0D\u4E86\u54E6 \u6211\u95EE\u4E3A\u4EC0\u4E48\uFF0C\u5927\u59D0\u8BF4\uFF0C\u6211\u4EEC\u7F51\u7EDC\u574F\u4E86 \u6211\u5F88\u6FC0\u52A8\uFF0C\u6211\u6211\u6211\uFF0C\u6211\u4F1A\u4FEE\uFF0C\u6211\u662F\u4E13\u4E1A\u7684 \u5927\u59D0\u8BF4\uFF1A\u6EDA</p><p>\u6709\u610F\u601D\u3002 \u4E0D\u88AB\u4FE1\u4EFB\u7684\u6280\u672F\u6C34\u5E73\uFF0C\u4E00\u76F4\u662F\u6211\u6821\u5B66\u5B50\u5F97\u4EE5\u594B\u8FDB\u7684\u52A8\u529B\u2026 \u8FD9\u4E2A\u4F18\u826F\u4F20\u7EDF\u4E09\u5E74\u6CA1\u53D8\u8FC7\uFF0C\u7ED9\u4F60\u70B9\u4E2A\u8D5E\uFF0C\u6211\u9009\u62E9\u6B7B\u4EA1\u3002</p><h3 id="\u8FCE\u65B0\u665A\u4F1A" tabindex="-1"><a class="header-anchor" href="#\u8FCE\u65B0\u665A\u4F1A" aria-hidden="true">#</a> \u8FCE\u65B0\u665A\u4F1A</h3><p>\u51E0\u5929\u91CC\u9A91\u7740 ofo \u5C0F\u9EC4\u8F66\u5728\u6821\u56ED\u778E\u901B \u8FD9\u4E2A\u5B63\u8282\u5BF9\u4E8E\u6B66\u6C49\uFF0C\u7B80\u76F4\u662F\u79CD\u6069\u8D50\u3002 \u98CE\u5F88\u67D4\u548C\uFF0C\u9633\u5149\u53EF\u4EE5\u628A\u5F71\u5B50\u62FD\u5F97\u597D\u957F \u8377\u5858\u5145\u76C8\uFF0C\u6842\u82B1\u4E5F\u5F00\u4E86 \u68A7\u6850\u53F6\u7684\u7EFF\u8FD8\u5728\u7EF5\u5EF6\uFF0C\u51C6\u5907\u7B49\u5F85\u4E00\u591C\u79CB\u96E8\u77AC\u95F4\u67D3\u7EA2\u7684\u8F89\u714C\u3002</p><p>\u665A\u4E0A\u521A\u597D\u9047\u5230\u8FCE\u65B0\u665A\u4F1A\uFF0C\u51B3\u5B9A\u53BB\u770B\u770B\u3002 \u7AEF\u7740\u5355\u53CD\u8D70\u8FDB\u4F1A\u573A\uFF0C\u5FC3\u91CC\u8FD8\u60F3\u7740\u600E\u4E48\u8BF4\u6E05\u695A\u6211\u4E0D\u662F\u65B0\u751F\uFF0C\u4F46\u5E0C\u671B\u6709\u4E2A\u5EA7\u4F4D\u8FD9\u56DE\u4E8B\u3002 \u8FCE\u9762\u4E00\u4E2A\u5B66\u751F\u4F1A\u9886\u8896\u8EAB\u4EFD\u7684\u4EBA\uFF0C\u8FC7\u6765\u5C31\u5BF9\u6211\u8BF4\uFF1A\u4F60\u7EC8\u4E8E\u6765\u4E86\uFF0C\u5750\u7B2C\u4E00\u6392\u5427\uFF0C\u8FD9\u4F4D\u7F6E\u597D\u62CD\u7167\u2026 \u5B8C\u4E86\u8FD8\u7ED9\u6211\u51E0\u9897\u7CD6\u5403\uFF0C\u592A\u8D34\u5FC3\u4E86\uFF01 \u8FD9\u4F4D\u5B66\u5F1F\uFF0C\u4F60\u4E5F\u662F\u6211\u7684\u8D35\u4EBA\u2026\u4F46\u5E0C\u671B\u4F60\u5DE5\u4F5C\u4ED4\u7EC6\u70B9\u554A</p><p>\u90A3\u5C31\u53EA\u80FD\u5192\u5145\u662F\u8BB0\u8005\u90E8\u7684\u5B66\u5F1F\u4E86\uFF01 \u665A\u4F1A\u5F00\u59CB\u524D\uFF0C\u6211\u5C31\u60F3\uFF0C\u6BD5\u7ADF\u6211\u6BD4\u4ED6\u4EEC\u5927 7 \u5C81 \u4F1A\u4E0D\u4F1A\u6709\u4EE3\u6C9F\uFF1F \u4F1A\u4E0D\u4F1A\u6709\u9B3C\u755C\u89C6\u9891\uFF1F \u4F1A\u4E0D\u4F1A\u4E00\u4E0A\u6765\u5C31\u8DF3\u300A\u6781\u4E50\u51C0\u571F\u300B\uFF1F</p><p>\u4E8B\u5B9E\u4E0A\uFF0C\u665A\u4F1A\u975E\u5E38\u7684\u5C0F\u6E05\u65B0\uFF0C\u66F4\u591A\u7684\u662F\u624D\u827A\u5C55\u793A\u3002 \u60F3\u5230\u5F88\u591A\u4EE5\u524D\u7684\u4E8B\u60C5\uFF0C\u4E5F\u60F3\u5230\u504C\u5927\u7684\u6821\u56ED\uFF0C\u51E0\u4E4E\u6CA1\u6709\u6211\u8BA4\u8BC6\u7684\u4EBA\u4E86\u3002 \u4F46\u6709\u8FD9\u7FA4\u53EF\u7231\u7684\u5B66\u5F1F\u5B66\u59B9\uFF0C\u534E\u79D1\u4EBA\u4E5F\u4F1A\u50CF\u68A7\u6850\u53F6\u4E00\u6837\uFF0C\u5468\u800C\u590D\u59CB\u7684\u6210\u957F\u5427\u3002 \u603B\u4E4B\u662F\u4E2A\u5947\u5999\u800C\u5B8C\u7F8E\u7684\u591C\u665A\u3002</p><p>\u55EF\uFF0C\u7CD6\u4E5F\u633A\u751C\u7684\u2026</p><h3 id="\u53C8\u4E00\u6BB5\u8DEF" tabindex="-1"><a class="header-anchor" href="#\u53C8\u4E00\u6BB5\u8DEF" aria-hidden="true">#</a> \u53C8\u4E00\u6BB5\u8DEF</h3><p>\u529E\u5B8C\u4E8B\u60C5\uFF0C\u6821\u56ED\u4E5F\u901B\u5F97\u5DEE\u4E0D\u591A\uFF0C\u6211\u77E5\u9053\u8BE5\u79BB\u53BB\u4E86\u3002 \u4F46\u8FD8\u6709\u65F6\u95F4\uFF0C\u6211\u8BA1\u5212\u53BB\u53E6\u5916\u4E00\u4E2A\uFF0C\u79BB\u6B66\u6C49\u4E0D\u8FDC\u7684\u5730\u65B9\u73A9\u73A9\u3002 \u795E\u519C\u67B6\u3001\u4E09\u5CE1\u3001\u5E90\u5C71\u3001\u5357\u660C\uFF0C\u56DB\u9009\u4E00\u3002 \u4E0D\u60F3\u51FA\u6E38\u88AB\u592A\u591A\u56E0\u7D20\u5E72\u6270\uFF0C\u629B\u4E86\u4E24\u4E2A\u786C\u5E01\u51B3\u5B9A\u3002 \u5357\u660C\u3002</p><p>\u53BB\u5357\u660C\uFF0C\u6211\u5C31\u53EF\u4EE5\u51D1\u9F50\u4E09\u5927\u540D\u697C\u3002 \u4F46\u4E4B\u524D\u7684\u9EC4\u9E64\u697C\u548C\u5CB3\u9633\u697C\u90FD\u4E0D\u7B97\u5F88\u6EE1\u610F\uFF0C\u6211\u8FD9\u6B21\u628A\u5FC3\u7406\u9884\u671F\u964D\u5230\u6700\u4F4E\u3002 \u8FD9\u6837\u4E00\u6765\uFF0C\u89C9\u5F97\u6ED5\u738B\u9601\u8FD8\u4E0D\u9519\u3002 \u6709\u65F6\u5019\u60F3\uFF0C\u5CB3\u9633\u697C\u8BB0\u91CC\u7684\u201C\u4E0D\u4EE5\u7269\u559C\u4E0D\u4EE5\u5DF1\u60B2\u201D\u5883\u754C\u592A\u9AD8\uFF0C\u4E0D\u662F\u6BCF\u4E2A\u4EBA\u90FD\u80FD\u8FBE\u5230\u7684\u3002 \u5982\u679C\u8FD9\u7897\u9E21\u6C64\u4F60\u559D\u4E0D\u4E0B\uFF0C\u5C31\u50CF\u738B\u52C3\u4E00\u6837\u771F\u6027\u60C5\u597D\u4E86\u3002 \u5B64\u9E5C\u4E0D\u89C1\uFF0C\u843D\u971E\u5E38\u5728\uFF0C\u8BE5\u7B11\u5C31\u7B11\uFF0C\u8BE5\u54ED\u5C31\u54ED\uFF0C\u6709\u4EC0\u4E48\u5927\u4E0D\u4E86\uFF1F</p><p>\u665A\u4E0A\u8054\u7CFB\u4E00\u4E2A\u8001\u670B\u53CB\uFF0C\u544A\u8BC9\u4ED6\u6211\u6765\u4F60\u5BB6\u4E61\u5566 \u4ED6\u89C9\u5F97\u6211\u592A\u6F47\u6D12\uFF0C\u53C8\u8DD1\u53BB\u73A9\u513F\u4E86\u3002</p><p>\u90A3\u65F6\u6211\u6B63\u5728\u79CB\u6C34\u5E7F\u573A\u770B\u8FD9\u4E00\u6C5F\u7684\u79CB\u6C34 \u604D\u60DA\u95F4\uFF0C\u53C8\u60F3\u8D77\u6BD5\u4E1A\u65F6\u884C\u674E\u4E0D\u89C1\u7684\u60C5\u666F \u6211\u51B2\u51FA\u52A8\u8F66\u7AD9\uFF0C\u65C1\u8FB9\u4EBA\u6765\u4EBA\u5F80\uFF0C\u6211\u4E00\u4EBA\u7AD9\u5728\u90A3\u611F\u89C9\u8EAB\u4F53\u52A8\u4E0D\u4E86\uFF0C\u5357\u98CE\u547C\u547C\u5730\u5439 \u53EA\u5269\u4E0B\u4E00\u526F\u8033\u673A\uFF0C\u653E\u7740\u4E94\u6708\u5929\u7684\u300A\u5B59\u609F\u7A7A\u300B\uFF0C\u91CC\u9762\u5531\u9053\uFF1A</p><p><strong>\u201C\u5982\u679C\u8981\u8BA9\u6211\u6D3B \u8BF7\u7ED9\u6211\u5FEB\u4E50\u82E6\u75DB \u6211\u4ECE\u4E0D\u6015\u7231\u9519 \u5C31\u6015\u6CA1\u7231\u8FC7\u2026\u201D</strong></p><p>\u6709\u65F6\u5019 \u4F60\u4EEC\u89C9\u5F97\u6211\u6D6A\u7684\u98CE\u751F\u6C34\u8D77\u65F6\uFF0C \u6211\u53EA\u4E0D\u8FC7\u53C8\u662F\u72EC\u81EA\u4E00\u4EBA\uFF0C\u8D70\u8FC7\u4E86\u4E00\u6BB5\u5FEB\u4E50\u53C8\u82E6\u75DB\u7684\u8270\u96BE\u8DEF\u7A0B\u5440\u3002</p>',24),_=e("\u2014\u2014 END. Litten on 10.20 \uFF08"),l=e("\u4E00\u4E9B\u7167\u7247\u5728"),f